        axios.get('http://localhost:5000/api/jobs').then((response) => {

            console.log(response.data)
            setjobs(response.data);

        });
    },[])
    console.log(jobs)
    return (
        <>
        <h2>Jobs</h2>
        {jobs && jobs.map((job)=>(
            <div>
            <p>jobs.heading</p>
            <p>jobs.branch</p>
            </div>
        ))}
        </>

    )
}

export default Jobspage;
